import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Box,
  Container,
  Typography,
  Stepper,
  Step,
  StepLabel,
  Button,
  Paper,
  TextField,
  FormControl,
  FormControlLabel,
  Radio,
  RadioGroup,
  MenuItem,
  Grid,
  Slider,
} from '@mui/material';
import { useForm, Controller, FieldValues } from 'react-hook-form';

const steps = ['Financial Details', 'Business Details', 'Credit History', 'Operational Details', 'Additional Information'];

interface FinancialDetails {
  storeName: string;
  monthlySales: number;
  profitMargin: number;
  monthlyEMI: number;
  averageBankBalance: number;
  buildingOwnership: 'own' | 'rent';
  collateralProvided: boolean;
  itrFiled: boolean;
}

const StoreDetails = () => {
  const [activeStep, setActiveStep] = useState(0);
  const navigate = useNavigate();
  const { control, handleSubmit, formState: { errors } } = useForm<FinancialDetails>();

  const handleNext = () => {
    setActiveStep((prevStep) => prevStep + 1);
  };

  const handleBack = () => {
    setActiveStep((prevStep) => prevStep - 1);
  };

  const onSubmit = (data: FinancialDetails) => {
    console.log(data);
    handleNext();
  };

  const getErrorMessage = (error: any): string => {
    return error?.message?.toString() || '';
  };

  const renderStepContent = (step: number) => {
    switch (step) {
      case 0:
        return (
          <form onSubmit={handleSubmit(onSubmit)}>
            <Grid container spacing={3}>
              <Grid item xs={12}>
                <Controller
                  name="storeName"
                  control={control}
                  defaultValue=""
                  rules={{ required: 'Store name is required' }}
                  render={({ field }) => (
                    <TextField
                      {...field}
                      label="Store Name"
                      fullWidth
                      error={!!errors.storeName}
                      helperText={getErrorMessage(errors.storeName)}
                    />
                  )}
                />
              </Grid>
              <Grid item xs={12} md={6}>
                <Controller
                  name="monthlySales"
                  control={control}
                  defaultValue={0}
                  rules={{ required: 'Monthly sales is required' }}
                  render={({ field }) => (
                    <TextField
                      {...field}
                      label="Monthly Sales (₹)"
                      type="number"
                      fullWidth
                      error={!!errors.monthlySales}
                      helperText={getErrorMessage(errors.monthlySales)}
                    />
                  )}
                />
              </Grid>
              <Grid item xs={12} md={6}>
                <Controller
                  name="profitMargin"
                  control={control}
                  defaultValue={0}
                  rules={{ required: 'Profit margin is required' }}
                  render={({ field }) => (
                    <Box>
                      <Typography gutterBottom>
                        Profit Margin: {field.value}%
                      </Typography>
                      <Slider
                        {...field}
                        valueLabelDisplay="auto"
                        step={1}
                        marks
                        min={0}
                        max={100}
                        valueLabelFormat={(value) => `${value}%`}
                        sx={{ mt: 2 }}
                      />
                    </Box>
                  )}
                />
              </Grid>
              <Grid item xs={12} md={6}>
                <Controller
                  name="monthlyEMI"
                  control={control}
                  defaultValue={0}
                  rules={{ required: 'Monthly EMI is required' }}
                  render={({ field }) => (
                    <TextField
                      {...field}
                      label="Monthly EMI (₹)"
                      type="number"
                      fullWidth
                      error={!!errors.monthlyEMI}
                      helperText={getErrorMessage(errors.monthlyEMI)}
                    />
                  )}
                />
              </Grid>
              <Grid item xs={12} md={6}>
                <Controller
                  name="averageBankBalance"
                  control={control}
                  defaultValue={0}
                  rules={{ required: 'Average bank balance is required' }}
                  render={({ field }) => (
                    <TextField
                      {...field}
                      label="Average Bank Balance (₹)"
                      type="number"
                      fullWidth
                      error={!!errors.averageBankBalance}
                      helperText={getErrorMessage(errors.averageBankBalance)}
                    />
                  )}
                />
              </Grid>
              <Grid item xs={12}>
                <FormControl component="fieldset">
                  <Typography variant="subtitle1" gutterBottom>
                    Building Ownership
                  </Typography>
                  <Controller
                    name="buildingOwnership"
                    control={control}
                    defaultValue="rent"
                    rules={{ required: 'Building ownership is required' }}
                    render={({ field }) => (
                      <RadioGroup {...field}>
                        <FormControlLabel value="own" control={<Radio />} label="Own" />
                        <FormControlLabel value="rent" control={<Radio />} label="Rent" />
                      </RadioGroup>
                    )}
                  />
                </FormControl>
              </Grid>
              <Grid item xs={12}>
                <FormControl component="fieldset">
                  <Typography variant="subtitle1" gutterBottom>
                    Collateral Provided
                  </Typography>
                  <Controller
                    name="collateralProvided"
                    control={control}
                    defaultValue={false}
                    rules={{ required: 'Collateral information is required' }}
                    render={({ field }) => (
                      <RadioGroup {...field} value={field.value ? 'yes' : 'no'}>
                        <FormControlLabel value="yes" control={<Radio />} label="Yes" />
                        <FormControlLabel value="no" control={<Radio />} label="No" />
                      </RadioGroup>
                    )}
                  />
                </FormControl>
              </Grid>
              <Grid item xs={12}>
                <FormControl component="fieldset">
                  <Typography variant="subtitle1" gutterBottom>
                    ITR Filed Regularly
                  </Typography>
                  <Controller
                    name="itrFiled"
                    control={control}
                    defaultValue={false}
                    rules={{ required: 'ITR filing information is required' }}
                    render={({ field }) => (
                      <RadioGroup {...field} value={field.value ? 'yes' : 'no'}>
                        <FormControlLabel value="yes" control={<Radio />} label="Yes" />
                        <FormControlLabel value="no" control={<Radio />} label="No" />
                      </RadioGroup>
                    )}
                  />
                </FormControl>
              </Grid>
            </Grid>
          </form>
        );
      default:
        return null;
    }
  };

  return (
    <Container maxWidth="md">
      <Box sx={{ py: 4 }}>
        <Typography variant="h4" align="center" gutterBottom>
          Store Details
        </Typography>
        <Paper sx={{ p: 4, mt: 4 }}>
          <Stepper activeStep={activeStep} sx={{ mb: 4 }}>
            {steps.map((label) => (
              <Step key={label}>
                <StepLabel>{label}</StepLabel>
              </Step>
            ))}
          </Stepper>

          {renderStepContent(activeStep)}

          <Box sx={{ display: 'flex', justifyContent: 'space-between', mt: 4 }}>
            <Button
              disabled={activeStep === 0}
              onClick={handleBack}
              variant="outlined"
            >
              Back
            </Button>
            {activeStep === steps.length - 1 ? (
              <Button
                type="submit"
                variant="contained"
                color="primary"
                onClick={handleSubmit(onSubmit)}
              >
                Calculate Score
              </Button>
            ) : (
              <Button
                variant="contained"
                color="primary"
                onClick={handleSubmit(onSubmit)}
              >
                Next
              </Button>
            )}
          </Box>
        </Paper>
      </Box>
    </Container>
  );
};

export default StoreDetails;
